import React from "react";
import logo from "../img/logoRG.png"
function Menu() {
    return(
        <nav className="navbar navbar-expand-sm bg-dark navbar-dark">
            <div className="container-fluid">
                <a className="navbar-brand"><img className="img-fluid" src={logo}/></a>
            </div>
        </nav>
    );
}
export default Menu;
